  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The CMS Data Compendium provides key
  statistics about CMS programs and national health expenditures.  The CMS Data Compendium
  contains historic, current, and projected data on Medicare enrollment and Medicaid
  recipients, expenditures, and utilization.  Data pertaining to budget, administrative
  and operating costs, individual income, financing, and health care providers and
  suppliers are also included.  National health expenditure data not specific to the
  Medicare or Medicaid programs are also included.  The CMS report was published annually
  in electronic form and is available for each year from 2002 through 2011.  The 2011
  version is the last version of this publication.  Similar information is available
  in the Medicare and Medicaid Statistical Supplement and the CMS Statistics, which
  are both published annually.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
